import { useMemo, Fragment } from "react";
import {
  Box,
  Title,
  Text,
  Card,
  rem,
  Tooltip,
  Grid,
  Alert,
  Button,
} from "@mantine/core";
import { useBreedImageUrl, useBreed } from "../APIs/cats";
import { BsWikipedia, BsFillHeartFill } from "react-icons/bs";
import { BiHomeSmile } from "react-icons/bi";
import { MdArrowBack, MdChildFriendly, MdEnergySavingsLeaf } from "react-icons/md";
import { FaDog, FaCat, FaSmileBeam } from "react-icons/fa";
import { RiKakaoTalkFill } from "react-icons/ri";
import { IoPeople } from "react-icons/io5";
import { GiHairStrands, GiComb, GiHealthNormal, GiBrain } from "react-icons/gi";
import { useParams, useNavigate } from "react-router-dom";

export function CatBreed() {
  const { breedId } = useParams();
  const { breed, error } = useBreed(breedId);
  const imageUrl = useBreedImageUrl(breedId);
  const navigate = useNavigate();

  const goBack = () => {
    navigate(-1);
  };

  return (
    <>
      <Box
        p={rem(16)}
        sx={{
          width: '100%',
          boxSizing: 'border-box'
        }}
      >
        <Button variant='outline' leftIcon={<MdArrowBack />} onClick={goBack}>Back</Button>
      </Box>
      <Box
        sx={{
          width: "100%",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          paddingTop: rem(16),
          paddingBottom: rem(16),
        }}
      >
        {error && <Alert title="Failed to load breed!">{error}</Alert>}
        {breed && (
          <>
            {imageUrl && (
              <img
                src={imageUrl}
                alt={`Image of ${breed.name} cat.`}
                style={{
                  width: "100%",
                  maxWidth: "350px",
                  objectFit: "cover",
                }}
              />
            )}
            <Title py={16}>{breed?.name}</Title>
            <Card>
              <Text>{breed.description}</Text>
            </Card>

            <BreedKnownFors breed={breed} />
            <WikipediaLink breed={breed} />
          </>
        )}
      </Box>
    </>
  );
}

function WikipediaLink({ breed }) {
  return (
    <Box
      component="a"
      href={breed.wikipedia_url}
      sx={{
        display: "flex",
        alignItems: "center",
        gap: rem(8),
        textDecoration: "none",
      }}
    >
      <BsWikipedia />
      <Text>View on Wikipedia</Text>
    </Box>
  );
}

const attributes = {
  adaptability: {
    display: {
      high: "Adapts Well",
      low: "Does not Adapt Well",
    },
    Icon: BiHomeSmile,
  },
  affection_level: {
    display: {
      high: "Very Affectionate",
      low: "Independent",
    },
    Icon: BsFillHeartFill,
    ambiguous: true
  },
  child_friendly: {
    display: {
      high: "Child Friendly",
      low: "Not Child Friendly",
    },
    Icon: MdChildFriendly,
  },
  dog_friendly: {
    display: {
      high: "Dog Friendly",
      low: "Not Dog Friendly",
    },
    Icon: FaDog,
  },
  energy_level: {
    display: {
      high: "High Energy",
      low: "Low Energy",
    },
    Icon: MdEnergySavingsLeaf,
  },
  grooming: {
    display: {
      high: "High Grooming",
      low: "Low Grooming",
    },
    Icon: GiComb,
    inverse: true
  },
  health_issues: {
    display: {
      high: "Prone to health issues",
      low: "",
    },
    Icon: GiHealthNormal,
    inverse: true
  },
  intelligence: {
    display: {
      high: "Intelligent",
      low: undefined,
    },
    Icon: GiBrain,
  },
  shedding_level: {
    display: {
      high: "Sheds a lot",
      low: "Sheds a little",
    },
    Icon: GiHairStrands,
    inverse: true
  },
  social_needs: {
    display: {
      high: "Social",
      low: "Not Social",
    },
    Icon: FaCat,
  },
  stranger_friendly: {
    display: {
      high: "Stranger Friendly",
      low: "Not Stranger Friendly",
    },
    Icon: IoPeople,
  },
  vocalisation: {
    display: {
      high: "Vocal",
      low: "Quiet",
    },
    Icon: RiKakaoTalkFill,
    ambiguous: true
  },
};

function BreedKnownFors({ breed }) {
  const values = useMemo(() => {
    const values = Object.entries(breed).filter(
      ([key, value]) => key in attributes
    );

    const highest = Math.max(
      4,
      values.reduce(
        (acc, [key, value]) => (value > acc ? value : acc), 0
      )
    )

    return values
      .filter(([_, value]) => value === highest || value === 1)
      .sort(([keyA, a], [keyB, b]) => {
        const attrA = attributes[keyA];
        const attrB = attributes[keyB];

        const orderA = (attrA.ambiguous ? AttributeOrder.Middle : a === 1 ? AttributeOrder.Low : AttributeOrder.High) * (attrA.inverse ? -1 : 1);
        const orderB = (attrB.ambiguous ? AttributeOrder.Middle : b === 1 ? AttributeOrder.Low : AttributeOrder.High) * (attrB.inverse ? -1 : 1);

        return orderB - orderA;
      })
      .map(([key, value]) => {
        const attr = attributes[key];
        const Icon = attr.Icon;
        const display = attr.display[value === 1 ? "low" : "high"];

        const element = display && (
          <Box
            sx={{
              display: "flex",
              alignItems: "center",
              gap: rem(8),
            }}
          >
            <Icon />
            <Text>{display}</Text>
          </Box>
        );

        return [key, element];
      });
  }, [breed]);

  return (
    <Card spacing={32} py={32} sx={{ width: "100%", boxSizing: "border-box", justifyContent: 'center' }}>
      {values.map(([key, value]) => (
        <Fragment key={key}>
          {value}
        </Fragment>
      ))}
    </Card>
  );
}

const AttributeOrder = {
  Low: -1,
  High: 1,
  Middle: 0
}
